#urlbar [src*='wikipedia.org'], tab [src*='wikipedia.org'], #urlbar [src*='commons.wikimedia.org'], tab [src*='commons.wikimedia.org'] 
{ width: 0 !important; background:url("data:image/png;base64,") no-repeat !important; }
tab [src*='wikipedia.org'], tab [src*='commons.wikimedia.org'] { margin: 1px 2px 1px 2px !important; }
[src*='wikipedia.org']:not(.screenshot), [src*='commons.wikimedia.org']:not(.screenshot) { padding-right: 16px !important; }
